import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Avatar from '@mui/material/Avatar';
import logo from '../logo.svg';
import "../App.css";
function createData(logo,name, status, access, protein) {
  return {logo, name, status, access,  protein };
}

const rows = [
  createData(<Avatar alt="Remy Sharp" className="logo" src={logo}/>,'Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData(<Avatar alt="Remy Sharp" src={logo}/>,'Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Gingerbread', 356, 16.0, 49, 3.9),
];

export default function BasicTable() {
  return (
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>

            <TableCell>Name</TableCell>
            <TableCell align="right">status</TableCell>
            <TableCell align="right">access</TableCell>
            {/* <TableCell align="right">Carbs&nbsp;(g)</TableCell> */}

          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >

              <TableCell component="th" scope="row" >
            {row.logo} <p>{row.name}</p>
              </TableCell>
              <TableCell align="right">{row.status}</TableCell>
              <TableCell align="right">{row.access}</TableCell>
              <TableCell align="right">{row.carbs}</TableCell>

            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
